import React from "react";
import styles from "./Post.module.css";
import Modal from "../UI/Modal/Modal";

const Post = props => {
  return (
    <>
      <Modal open={props.open} openHandler={props.openHandler}>
        {props.entry}
      </Modal>
      <hr />
      <div className={styles.Post} onClick={props.postSelector}>
        {props.entry}
      </div>
    </>
  );
};

export default Post;
